import React from 'react';

const ToDo = (props) => {
    const {id, title, completed} = props.todo;
    return (
        <div>
            <h1>ID: {id}</h1>
            <h3>Title: {title}</h3>
            <h4>Task Status: {}</h4>
        </div>
    );
};

export default ToDo;
